script: |
  super -f text -I q10367.spq | sort > q10367.out

inputs:
  - name: q10367.spq
    data: |
      SELECT - col2 + + tab1.col0 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT col1 IN ( + tab1.col2 * - col2 * col1 );
  - name: tab1

outputs:
  - name: q10367.out
    data: |
      -16
      -51
      7
